info:
europäische Politik der Lebensmittelsicherheit, Gewährleistung eines hohen Maßes an Lebensmittelsicherheit in der EU durch kohärente Maßnahmen im Agrarsektor und angemessene Überwachung bei gleichzeitiger Gewährleistung eines wirksamen Binnenmarkts. Dies erfordert folgende Maßnahmen:

  Sicherstellung wirksamer Kontrollsysteme und Beurteilung der Einhaltung der EU-Standards zu Lebensmittelsicherheit und -qualität in der EU sowie in Drittländern in Bezug auf Exporte in die EU;
Unterhaltung internationaler Beziehungen zu Drittländern und internationalen Organisationen in Bezug auf die Lebensmittelsicherheit;
Unterhaltung von Beziehungen zur Europäischen Behörde für Lebensmittelsicherheit (EFSA) und Gewährleistung eines wissenschaftlich begründeten Risikomanagements.
